import React, {Component} from "react"

export default class Login extends Component 
{
    constructor(props) 
    {
        super(props);
        this.state = {isCool: "Hello"}
    }

    render() 
    {
        return (
            <div className="Login">
                <h1>{this.state.isCool}</h1>
            </div>
        )
    }
}
